const styles = (theme) => ({
  status: {
    fontSize: 15,
  },
  open: {
    color: theme.palette.error.main,
  },
  responseReceived: {
    color: theme.palette.alert.main,
  },
  resolved: {
    color: theme.palette.success.main,
  },
});

export default styles;
